"""
LeetCode Question #1496: Path Crossing

Problem Statement:
You are given a string `path`, where `path[i]` is the direction you move on the `i`th step. 
The directions are 'N', 'S', 'E', and 'W', representing north, south, east, and west, respectively. 
You start at the origin (0, 0) on a 2D plane and walk based on the given path.

Return `True` if the path crosses itself at any point, i.e., if you visit a location twice. Otherwise, return `False`.

Example 1:
Input: path = "NES"
Output: False
Explanation: The path does not cross itself.

Example 2:
Input: path = "NESWW"
Output: True
Explanation: The path visits the origin (0, 0) twice.

Constraints:
- 1 <= path.length <= 10^4
- path[i] is either 'N', 'S', 'E', or 'W'.
"""

# Solution
def isPathCrossing(path: str) -> bool:
    # Initialize the starting position
    x, y = 0, 0
    # Use a set to track visited positions
    visited = set()
    visited.add((x, y))
    
    # Iterate through the path
    for direction in path:
        if direction == 'N':
            y += 1
        elif direction == 'S':
            y -= 1
        elif direction == 'E':
            x += 1
        elif direction == 'W':
            x -= 1
        
        # Check if the current position has been visited
        if (x, y) in visited:
            return True
        visited.add((x, y))
    
    return False

# Example Test Cases
if __name__ == "__main__":
    # Test Case 1
    path1 = "NES"
    print(isPathCrossing(path1))  # Output: False

    # Test Case 2
    path2 = "NESWW"
    print(isPathCrossing(path2))  # Output: True

